import React from "react";
import "../styles/custom.css";

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-overlay"></div>
      <img src="/home.jpg" className="home-bg" alt="Delicious Food" />
      <div className="home-content">
        <h1 className="home-title animate__animated animate__fadeInDown">Discover & Share Amazing Recipes</h1>
        <p className="home-subtitle animate__animated animate__fadeInUp">Join our food-loving community today.</p>
        <a href="/register" className="btn btn-primary btn-lg home-cta animate__animated animate__bounceIn">
          Get Started
        </a>
      </div>
    </div>
  );
};

export default Home;
